text:
@PatrikNacher @kolovratnikm @jhamacek To že se připravuje delší čas je OK, to chápeme ale jaký je kontext, že tam má svůj úvodník premiér? 
On má nějaký odborný vztah k tomu tématu? 
To by tam pak mohli napsat úvodník všichni členové vlády a třeba i všichni poslanci, s odůvodněním, že třeba projednáváme rozpočet🙉

@lukasprikner @VyvleckovaM A. OK, tak pro něj pracujete. 
B. Jedna rada do života. Urážením veřejně jakékoliv ženy a označovat ji za blbou z Vás chlapa neudělá. Pro většinu lidí zůstane idiotem.
C. KDU-ČSL se za svou chybu omluvila a už jí znovu neudělala. To není příklad Okamury.

Udelame maximum, abychom zvratili vysledek voleb. Jit mezi lidi je nejlepší cesta. 99,9 procent reakcí je pozitivních 💙💛💜

@SpoluKoalice 

https://t.co/rARIlztppm

@oldafojtik @NemecekSva @Nazory_Aktualne 1. Nepřitápět pod kotel obřími deficity.
2. Nevyzývat centrální banku, aby držela úroky nízko.
Minimálně tyhle dvě věci, kterých se dopouští, jdou proti snahám o zmírnění zdražování.

@AndrejBabis Pane premiére, mimořádnou schůzi Sněmovny opravdu nelze označit za lidový soud.

Jedná se o standardní nástroj, který se v demokracii běžně využívá. 

V případě zájmu máme mnoho expertů, kteří vám rádi vysvětlí, jak Sněmovna funguje.😉

